import './App.css';
import Startpage from './components/Startpage';
import { Routes, Route } from "react-router-dom";
import EngineConfigView from './components/EngineConfigView';
import ColorConfigView from './components/ColorConfigView';
import InteriorConfigView from './components/InteriorConfigView';
import WheelConfigView from './components/WheelConfigView';


function App() {
  return (
    <div className="mx-5 h-100" >
      <Routes>
        <Route path="/" exact element={<Startpage />} />
        <Route path="/engineConfig" exact element={<EngineConfigView />} />
        <Route path="/colorConfig" exact element={<ColorConfigView />} />
        <Route path="/interiorConfig" exact element={<InteriorConfigView />} />
        <Route path="/wheelConfig" exact element={<WheelConfigView />} />
        <Route path="/extraConfig" exact element={<ColorConfigView />} />

      </Routes>
    </div>
  );
}

export default App;
